import React from "react";
import { Button, DatePicker, version } from "antd";
import "antd/dist/antd.css";
import "./index.css";

const CssView = () => {
  return (
    <>
      <h1>Css Testboard!</h1>
        <DatePicker />
        <Button type="primary" style={{ marginLeft: 8 }}>
            Primary Button
        </Button>
    </>
  );
};

export default CssView;
